      let calc=(value-value+525)
      setCalc(calc.toFixed(1))
     }else {
     let calc=(value*0.014)
    setCalc(calc.toFixed(1))
     }
     let rat=(calc/3)
     setRat(rat.toFixed(0))
    } 
    
